parameters.jsCode:
return items.map(item => {
  const clicks = item.json['clicks'];
  const impressions = item.json['impressions'];
  const cost = item.json['spends'];
  item.json['CTR'] = (clicks / impressions) * 100 || 0;
  item.json['CPC'] = (cost / clicks) || 0;
  item.json['CPM'] = (cost / (impressions / 1000)) || 0;
  return item;
});

